import React from "react";
import styled from "styled-components";
import { makeStyles } from "@material-ui/core/styles";
import { Container, Text } from "../styledComponents";
import userPhoto from "../../public/static/sandy.jpeg";
import { Avatar } from "@material-ui/core";

const useStyles = makeStyles(theme => ({
  menuButton: {
    marginRight: 36
  },
  hide: {
    display: "none"
  },

  drawerPaper: {
    paddingLeft: 100,
    paddingRight: 100,
    height: 64
  },
  menuPaper: {
    display: "flex",
    flex: 1,
    flexDirection: "column",
    backgroundColor: "white",
    width: 150,
    borderRadius: 2,
    marginBottom: 5,
    marginTop: 25
  },
  menuItem: {
    height: 50
  },
  toolbar: {
    display: "flex",
    alignItems: "center",
    flexDirection: "row",
    justifyContent: "space-between",
    padding: theme.spacing(0, 1),
    ...theme.mixins.toolbar
  },
  content: {
    backgroundColor: customTheme.bgPrimary
  },
  small: {
    width: theme.spacing(7),
    height: theme.spacing(7)
  },

}));
const HouseWrapper = styled(Container)`
  display: flex;
  flex-direction: column;
  /* align-items: center;
  justify-content: space-between; */
  height: 350px;
  min-width: 320px;
  border: 1px solid #d5d8dc;
  margin-bottom: 20px;
  border-radius: 2px;
  background-color: white;
  &:hover {
    box-shadow: 0 3.2px 7.2px 0 rgba(0, 0, 0, 0.132),
      0 0.6px 1.8px 0 rgba(0, 0, 0, 0.108);
  }
`;

const CardHeader = styled(Container)`
  direction: flex;
  flex-direction: row;
  padding: 8px;
  width: 100%;
  align-items: center;
  background-color: transparent;
`;
const HouseItem = () => {
  return (
    <HouseWrapper>
      <CardHeader>
        <Avatar src={hasLogo} className={classes.small} />
        <Container flex={1} column color="transparent">
          <Text>Description</Text>
        </Container>

        <Container flex={false} color="transparent">
          <Text>Footer</Text>
        </Container>
      </CardHeader>
      <Text>Image</Text>
      <Text>Description</Text>
      <Text>Footer</Text>
    </HouseWrapper>
  );
};

export default HouseItem;
